import React from 'react';

function About() {
    return (
        <div>
            <h2>About Raz's Blog</h2>
            <p>
                Welcome to my personal blog, where I, Raz, share my thoughts and complaints about various topics.
            </p>
            <p>
                I hope you find my rants entertaining and relatable.
            </p>
        </div>
    );
}

export default About;
